INSERT INTO `products` VALUES (1,1,'Speakers','AsaS','21321321','3213','EA','yes','18','3100','5','4','3','2','<p>Testing</p>','<p>Testing</p>','1689969844234.jpeg','1689969844257.pdf',0,'2023-07-21 20:04:04','2023-08-09 13:27:11'),(2,3,'Live Mixer ','16 Ch Mixer','Yamaha MG16 XU ','100 ','EA','yes','18','80','80','81','72','2','<p>&nbsp;Should have 4x4_2x2 MU-MIMO with 4+2 spatial stream. Should support maximal ratio Combining Should be operable at 20, 40- and 80-MHz channels, should support data rates up to 575 Mbps over 802. 11n and 2400 Mbps over 802.11ax technology, should support A-MPDU (Tx/Rx), A-MSDU (Tx/Rx) packet aggregation. Should have cyclic delay diversity support, should have maximum like hood demodulation support, should have low density parity check support</p>','<p>&nbsp;abc</p>','1690005697579.png','1690005697588.pdf',0,'2023-07-22 06:01:37','2023-07-24 14:39:57'),(3,2,'Live Mixer  ','16 Ch Mixer','Yamaha MG16 XU  ','100 ','EA','yes','18','80','2','2','2','2','<p>The Consolidated Price shall be for the total Scope of works as detailed in the RFP. The Bidders are required to quote a consolidated amount quoted for the entire scope of this RFP excluding GST. GST would be reimbursed, as applicable at actuals during currency of this contract.</p>','<p>The Consolidated Price shall be for the total Scope of works as detailed in the RFP. The Bidders are required to quote a consolidated amount quoted for the entire scope of this RFP excluding GST. GST would be reimbursed, as applicable at actuals during currency of this contract.</p>','1690028985779.pdf','1690028985781.png',0,'2023-07-22 12:29:45','2023-07-24 14:39:54'),(4,20,'Speakers','sadsa','21321345','3213444','EA','yes','18','3212333','4','5','2','1','<h4>About this item</h4><ul><li>Power handling capacity - 6 Watts</li><li>Excellent frequency response</li><li>Optimised for music &amp; speech applications</li><li>Operating temperature-25C to +55C (-13F to +131F)Storage temperature-40C to +70C (-40F to +158F)Relative humidity&lt;95%</li></ul>','<h4>About this item</h4><ul><li>Power handling capacity - 6 Watts</li><li>Excellent frequency response</li><li>Optimised for music &amp; speech applications</li><li>Operating temperature-25C to +55C (-13F to +131F)Storage temperature-40C to +70C (-40F to +158F)Relative humidity&lt;95%</li></ul>','1690202117435.jpeg','1690202117436.pdf',0,'2023-07-24 12:35:17','2023-07-24 14:39:48'),(5,5,'Camera ','20X PTZ Camera','SONY 20X','100','EA','yes','18','70','4','5','4','8','<p>Hello, world!FAS SYSTEM Supply, Installation Testing &amp; Commissioning of microprocessor based Networkable Analogue Addressable Fire Alarm Control Panel. The Panel shall be compliant with EN54-2, EN54-4 and approved by LPCB. The Fire Alarm Control Panel shall have expandable capacity from 4 loops to 16 loops. The Panel must have Full colour 800 x 480 LCD with resistive touch screen and automatic backlight dimming. The Panel must also have the capability to take Addressable Intelligent Wired and Wireless Devices on same loop. Each loop shall have a capacity of 127 analogue Addressable devices and 127 Base sounders/Base Sounder Beacons. The panel shall have an event log of minimum 10,000 events @ 1 second resolution, Filterable and Printable. The Panel shall have Three access levels. Panel shall support upto 5000 Cause &amp; Effects entries, with upto 20,000 inputs controlling &amp; 20,000 Controlling outputs across the network. The Panel shall have capability for Peer to Peer networking through RS485 network card. The Panel must have 4 inbuilt programmable sounder circuits, each circuit rated at 2.5A.The Panel must have inbuilt 3 programmable inputs and 5 inbuilt programmable relay outputs. The Panel shall have up to sub-addressable 512 programmable Inputs/Outputs via optional RS485 COMMS serially connected &nbsp;expansion cards. The Panel shall have 240 V AC power supply along with automatic Battery Charger. The Panel shall be fully expandable via common plug in loop driver boards. The user shall have a choice of using the panel with 5.25 Amp or 10.25 Amp power supply unit &nbsp;which is inbuilt in the FACP and should be approved to EN54-4. The Panel shall have configurable via USB port to PC or memory stick. The Panel shall have dedicated RS232 serial port for optional printer. Approved by LPCBShould have Vds/ EN54/ UL &amp; FM Certification. &nbsp; Approved Makes: Hochiki / Bosch / Tyco &nbsp;Bidder Shall Submit OEM aurtorization &amp; Products Test Certificate Before Installtion &nbsp;</p>','<p>Hello, world!FAS SYSTEM Supply, Installation Testing &amp; Commissioning of microprocessor based Networkable Analogue Addressable Fire Alarm Control Panel. The Panel shall be compliant with EN54-2, EN54-4 and approved by LPCB. The Fire Alarm Control Panel shall have expandable capacity from 4 loops to 16 loops. The Panel must have Full colour 800 x 480 LCD with resistive touch screen and automatic backlight dimming. The Panel must also have the capability to take Addressable Intelligent Wired and Wireless Devices on same loop. Each loop shall have a capacity of 127 analogue Addressable devices and 127 Base sounders/Base Sounder Beacons. The panel shall have an event log of minimum 10,000 events @ 1 second resolution, Filterable and Printable. The Panel shall have Three access levels. Panel shall support upto 5000 Cause &amp; Effects entries, with upto 20,000 inputs controlling &amp; 20,000 Controlling outputs across the network. The Panel shall have capability for Peer to Peer networking through RS485 network card. The Panel must have 4 inbuilt programmable sounder circuits, each circuit rated at 2.5A.The Panel must have inbuilt 3 programmable inputs and 5 inbuilt programmable relay outputs. The Panel shall have up to sub-addressable 512 programmable Inputs/Outputs via optional RS485 COMMS serially connected &nbsp;expansion cards. The Panel shall have 240 V AC power supply along with automatic Battery Charger. The Panel shall be fully expandable via common plug in loop driver boards. The user shall have a choice of using the panel with 5.25 Amp or 10.25 Amp power supply unit &nbsp;which is inbuilt in the FACP and should be approved to EN54-4. The Panel shall have configurable via USB port to PC or memory stick. The Panel shall have dedicated RS232 serial port for optional printer. Approved by LPCBShould have Vds/ EN54/ UL &amp; FM Certification. &nbsp; Approved Makes: Hochiki / Bosch / Tyco &nbsp;Bidder Shall Submit OEM aurtorization &amp; Products Test Certificate Before Installtion &nbsp;</p>','1690202754752.jpeg','1690202754754.pdf',0,'2023-07-24 12:45:54','2023-07-24 14:39:44'),(6,1,'Speakers','AsaS','21321455','3213','EA','no','','33','8','4','11','5','<p>Supply, Installation Testing &amp; Commissioning of microprocessor based Networkable Analogue Addressable Fire Alarm Control Panel. The Panel shall be compliant with EN54-2, EN54-4 and approved by LPCB. The Fire Alarm Control Panel shall have expandable capacity from 4 loops to 16 loops. The Panel must have Full colour 800 x 480 LCD with resistive touch screen and automatic backlight dimming. The Panel must also have the capability to take Addressable Intelligent Wired and Wireless Devices on same loop. Each loop shall have a capacity of 127 analogue Addressable devices and 127 Base sounders/Base Sounder Beacons. The panel shall have an event log of minimum 10,000 events @ 1 second resolution, Filterable and Printable. The Panel shall have Three access levels. Panel shall support upto 5000 Cause &amp; Effects entries, with upto 20,000 inputs controlling &amp; 20,000 Controlling outputs across the network. The Panel shall have capability for Peer to Peer networking through RS485 network card. The Panel must have 4 inbuilt programmable sounder circuits, each circuit rated at 2.5A.The Panel must have inbuilt 3 programmable inputs and 5 inbuilt programmable relay outputs. The Panel shall have up to sub-addressable 512 programmable Inputs/Outputs via optional RS485 COMMS serially connected &nbsp;expansion cards. The Panel shall have 240 V AC power supply along with automatic Battery Charger. The Panel shall be fully expandable via common plug in loop driver boards. The user shall have a choice of using the panel with 5.25 Amp or 10.25 Amp power supply unit &nbsp;which is inbuilt in the FACP and should be approved to EN54-4. The Panel shall have configurable via USB port to PC or memory stick. The Panel shall have dedicated RS232 serial port for optional printer. Approved by LPCBShould have Vds/ EN54/ UL &amp; FM Certification. &nbsp; Approved Makes: Hochiki / Bosch / Tyco &nbsp;Bidder Shall Submit OEM aurtorization &amp; Products Test Certificate Before Installtion</p>','<p>Supply, Installation Testing &amp; Commissioning of microprocessor based Networkable Analogue Addressable Fire Alarm Control Panel. The Panel shall be compliant with EN54-2, EN54-4 and approved by LPCB. The Fire Alarm Control Panel shall have expandable capacity from 4 loops to 16 loops. The Panel must have Full colour 800 x 480 LCD with resistive touch screen and automatic backlight dimming. The Panel must also have the capability to take Addressable Intelligent Wired and Wireless Devices on same loop. Each loop shall have a capacity of 127 analogue Addressable devices and 127 Base sounders/Base Sounder Beacons. The panel shall have an event log of minimum 10,000 events @ 1 second resolution, Filterable and Printable. The Panel shall have Three access levels. Panel shall support upto 5000 Cause &amp; Effects entries, with upto 20,000 inputs controlling &amp; 20,000 Controlling outputs across the network. The Panel shall have capability for Peer to Peer networking through RS485 network card. The Panel must have 4 inbuilt programmable sounder circuits, each circuit rated at 2.5A.The Panel must have inbuilt 3 programmable inputs and 5 inbuilt programmable relay outputs. The Panel shall have up to sub-addressable 512 programmable Inputs/Outputs via optional RS485 COMMS serially connected &nbsp;expansion cards. The Panel shall have 240 V AC power supply along with automatic Battery Charger. The Panel shall be fully expandable via common plug in loop driver boards. The user shall have a choice of using the panel with 5.25 Amp or 10.25 Amp power supply unit &nbsp;which is inbuilt in the FACP and should be approved to EN54-4. The Panel shall have configurable via USB port to PC or memory stick. The Panel shall have dedicated RS232 serial port for optional printer. Approved by LPCBShould have Vds/ EN54/ UL &amp; FM Certification. &nbsp; Approved Makes: Hochiki / Bosch / Tyco &nbsp;Bidder Shall Submit OEM aurtorization &amp; Products Test Certificate Before Installtion</p>','1690215226844.jpeg','1690215226870.pdf',1,'2023-07-24 16:13:46','2023-07-24 16:13:46'),(7,1,'Speakers','sadsa','213213213','3213','EA','no','','2132','1','2','3','4','<p>Supply, Installation, Testing and Commissioning of IP based 4MP resolution (2560  1440), Dome Camera: H.265 4MP IR Vandal Proof Dome N/W Camera, 2.8mm Lens, Fixed Iris, horizontal field of view:110,Vertical: 77.6; Fixed Iris, 30M IR, &nbsp;Shutter Speed 1 s to 1/100,000 s, , DC12V/PoE, IP67/IK10, Basic IVA, Image sensor- 1 / 2.7 CMOS, Effective Pixels 2560  1440,Min. Illumination Color: 0.01 Lux @ F1.2, AGC ON; Color: 0.04 Lux @ F2.2, AGC ON; 0 lux with IR, Angle adjustment- Pan : 0-355, Tilt : 0-67, Rotation : 0-355, Focal Length- 2.8 mm @ F2.0,Defog, Lens Mount- M12, True day/night, 120dB WDR, Image features- 3D DNR, HLC &amp; BLC, Corridor Pattern, IR cut filter with auto switch, Triple streams, Support multi-stream real time transmission, 4 zones video mask, Smart codec by ROI, SNR&nbsp;</p>','<p>Supply, Installation, Testing and Commissioning of IP based 4MP resolution (2560  1440), Dome Camera: H.265 4MP IR Vandal Proof Dome&nbsp;</p>','1690215839994.jpeg','1690215839995.pdf',1,'2023-07-24 16:23:59','2023-07-24 16:23:59'),(8,1,'Speakers','sadsa','CU