sent globally for more than 20 years</td></tr></tbody></table></figure>','1690217229464.jpeg','1690217229467.pdf',1,'2023-07-24 16:47:09','2023-07-24 16:47:09'),(11,57,'PTZ CAMERA','CAMERA','elite 12x ','250000','EA','yes','18','00','1','2','3','4','<p><strong>PeopleLink 4K PTZ Elite 12x Camera for boardrooms. Elite 4kprovides 4k(38402160)@60fps high quality images with ultra-high resolution. The pant/tilt and zoom features that can be controlled with a remote and allow this camera to have a coverage of 80 degree angle. The 12x optical zoom and 16x digital zoom feature helps in capturing every minute detail including the facial expressions and gestures. The auto-brightness feature adjusts the bright- ness based on the available lighting conditions to ensure better video quality</strong></p><p>&nbsp;</p><p><br>&nbsp;</p>','<p><strong>UHD 4K resolution</strong></p><p>Adopts a new generation of sony 1/2.5 inch high quality uhd cmos sensor with a maximum of 8.4 million pixels, which can achieve 4k (38402160) high quality images with ultra-high resolution. And downward compatible with 1080p, 720p and other resolutions.</p><p><strong>12X optical zoom</strong></p><p>Adopt high quality real 8 million ultra-high resolution 4K ultra-telephoto lens, 12X optical zoom, the maximum field of view over 80</p><p><strong>HDMI 2.0</strong></p><p>Support HDMI specification, can directly output 4K uncompressed digital video.</p><p><strong>Low power sleep function</strong></p><p>Supports low power sleep/wake, power consumption is less than 400mW in sleep state.</p><p><strong>Local storage</strong></p><p>Support local storage function, without NVR can achieve U disk local direct recording.</p><p><strong>Low illumination</strong></p><p>The new cmos image sensor with ultra-high snr can effectively reduce the image noise under the condition of low illumination. At the same time, the 2d and 3d noise reduction algorithms can greatly reduce the image noise. Even under the condition of ultra-low illumination, the picture is still clean and clear, and the image signal-to-noise ratio reaches over 55db.</p><p><strong>Presentor Tracking</strong></p><p>Seamless tracking of the presenter</p><p><strong>Remote control</strong></p><p>Various control mode, can use RS232, RS485, network and USB, can control the camera.</p><p><strong>Built-in gravity sensor</strong></p><p>Support image automatic flip function, convenient installation and use of engineering.</p><p><strong>Smart exposure</strong></p><p>Effectively solve the impact of projection, TV and other equipment on the shooting of characters</p>','1690807088325.jpeg','1690807088326.pdf',1,'2023-07-31 12:38:08','2023-07-31 12:38:08');
