 technology and is a 2-Way passive loudspeaker containing a 1 exit compression driver assembled in a coaxial configuration along with a 12 LF driver providing a conical 90 opening. Further advantages of the coaxial approach includes a single point source radiation, total wave front coherency at all frequencies and superimposed LF/HF dispersion characteristics are free of the polar lobing effects typical of traditional horn and woofer combinations. The net result is natural studio monitor level sound quality that is ideal for proximity use.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>\",\"uom\":\"EA\",\"qty\":1,\"rate\":\"3200000\",\"mark_plus\":0,\"mark_minus\":20,\"total_price\":\"2560000.00\"}]','2560000.00','2023-07-06 16:23:02','2023-07-06 16:25:54','[{\"product\":6,\"description\":\"<p>Hello, world!The <strong>Pulz CX12 SMP</strong> loudspeaker provides a high quality high performance speaker system for behind the screen home theatre systems. The CX12 SMP incorporates true point source technology and is a 2-Way passive loudspeaker containing a 1 exit compression driver assembled in a coaxial configuration along with a 12 LF driver providing a conical 90 opening. Further advantages of the coaxial approach includes a single point source radiation, total wave front coherency at all frequencies and superimposed LF/HF dispersion characteristics are free of the polar lobing effects typical of traditional horn and woofer combinations. The net result is natural studio monitor level sound quality that is ideal for proximity use.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>\",\"uom\":\"EA\",\"qty\":1,\"rate\":\"3200000\",\"mark_plus\":0,\"mark_minus\":20,\"total_price\":\"2560000.00\",\"otherCharges\":[{\"cartage\":25600,\"totalOfProduct\":2585600,\"installationCharge\":258560,\"totalWithInstallation\":2844160,\"profit\":426624,\"lwc\":4266.24,\"costpereach\":\"3275050.24\"}],\"finalCostEach\":\"3275050.24\",\"isExpand\":fa